<!DOCTYPE html>
<html lang="zh-Hant">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>山老闆和廢物 YouTube 頻道合作官網</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #f0f8ff;
            color: #000;
        }
        header {
            background-color: #000;
            color: #fff;
            padding: 10px 0;
            text-align: center;
        }
        nav {
            margin: 10px 0;
            text-align: center;
        }
        nav a {
            margin: 0 15px;
            text-decoration: none;
            color: #000;
            font-size: 18px;
        }
        .tab-content {
            display: none;
            padding: 20px;
            border: 1px solid #000;
            background-color: #fff;
        }
        .active {
            display: block;
        }
        .profile-img {
            width: 150px;
            height: 150px;
            border-radius: 50%;
        }
        .cover-img {
            width: 100%;
            height: 200px;
            object-fit: cover;
        }
        .youtube-button {
            display: block;
            width: 200px;
            margin: 20px auto;
            padding: 10px;
            text-align: center;
            background-color: #000;
            color: #fff;
            text-decoration: none;
            border-radius: 5px;
        }
    </style>
</head>
<body>
    <header>
        <h1>山老闆和廢物 YouTube 頻道合作官網</h1>
    </header>
    <nav>
        <a href="#mountain_boss" onclick="showTab('mountain_boss')">山老闆</a>
        <a href="#faywoooo" onclick="showTab('faywoooo')">廢物</a>
    </nav>
