            在這個頻道裡，您將會看到一些有趣的知識、風景欣賞和心理障礙的種類介紹。<br>
            如果你喜歡我的影片，歡迎按讚、訂閱、開啟小鈴鐺並分享喔！<br>
            如果有想看的影片，可以留言給我喔！<br>
            留言不要觸犯法律、【YouTube社群規範】，也不要留一些垃圾話如「一起互相訂閱吧」<br>
            實話：國一、有個徹底失敗的頻道<br><br>
            2023.11.24 頻道創建<br>
            2023.12.26 100訂閱<br>
            2024.02.29 200訂閱<br>
            2024.05.16 300訂閱
        </p>
        <a href="https://youtube.com/@mountain_boss" class="youtube-button">訂閱山老闆 YouTube 頻道</a>
    </div>
    <div id="faywoooo" class="tab-content">
        <img src="https://yt3.googleusercontent.com/AvjlfV18lFMOeOvtoo2FbXqbEDbWcHID2A807cTa1leV_Uz7r7w0F-rAfdeVZG5k2ep5DRCbHw=s176-c-k-c0x00ffffff-no-rj" alt="廢物頭貼" class="profile-img">
        <img src="https://i.imgur.com/G0eu4GK.png" alt="廢物封面" class="cover-img">
        <p>
            本頻道主要拍攝影片剪輯教學、知識與程式教學<br>
            歡迎按讚訂閱分享喔~<br><br>
